(8, 7, 'Soal deret aritmatika', 'Tentukan jumlah [n] suku pertama dari deret aritmatika [u1]+[u2]+[u3]+...&nbsp;', 5, 'mapping', '[\'[n]\', \'[u1]\', \'[u2]\', \'[u3]\']', '[n]=20, 15, 23;\r\n[u1]=72, 70, 50;\r\n[u2]=80, 82, 61;\r\n[u3]=88, 94, 72', '[b] = [u2]-[u1];\r\n[benar] = ([n]/2) * ((2*[u1]) + ([n]-1)*[b]);\r\n[salah1] = ([n]/2) * ((2*[u1]) + ([n]+1)*[b]);\r\n[salah2] = [benar] + 20;\r\n[salah3] = [benar]  * 2', 'a. [benar]<br />\r\nb. [salah1]<br />\r\nc. [salah2]<br />\r\nd. [salah3]', '2020-06-05 01:39:05.291371', 17, 3, '---'),
(9, 7, 'Menyederhanakan pecahan', 'Bentuk paling sederhana dari&nbsp;<span class=\"math-tex\">\\([x] \\over [y]\\)</span>&nbsp;adalah?', 5, 'mapping', '[\'[x]\', \'[y]\']', '[x]=18, 30;\r\n[y]= 24, 36', '[a]=fpb([x], [y]);\r\n[b]=[x]/[a];\r\n[c]=[y]/[a];\r\n[d]=[b]+[c]', 'a. <span class=\"math-tex\">\\([b] \\over [c]\\)</span><br />\r\nb. <span class=\"math-tex\">\\([c] \\over [b]\\)</span><br />\r\nc. <span class=\"math-tex\">\\([b] \\over [d]\\)</span><br />\r\nd. <span class=\"math-tex\">\\([a] \\over [d]\\)</span>', '2020-06-05 08:17:30.877688', 18, 3, '---'),
(10, 7, 'Bangun ruang', 'Berikut ini yang merupakan ciri-ciri dari bangun ruang limas segi [n] adalah?', 5, 'mapping', '[\'[n]\']', '[n]=3,4,5,6,8,9,10', '[m] = [n] + 2;\r\n[l] = [n] - 1', 'a. memiliki [m] titik sudut<br />\r\nb. memiliki [l] sisi<br />\r\nc. memiliki [m] rusuk<br />\r\nd. memiliki [n] sisi tegak', '2020-06-06 03:28:07.676748', 22, 3, '---'),
(11, 8, 'Soal Perbandingan', 'Perbandingan&nbsp;banyak&nbsp;ayam&nbsp;potong&nbsp;dengan&nbsp;ayam&nbsp;petelur&nbsp;[x]:&nbsp;[y].&nbsp;Jika&nbsp;banyak&nbsp;ayam&nbsp;petelur&nbsp;ada&nbsp;[z]&nbsp;ekor,&nbsp;berapa&nbsp;banyak&nbsp;ayam&nbsp;potong?&nbsp;', 5, 'mapping', '[\'[x]\', \'[y]\', \'[z]\']', '[x]=4,10;\r\n[y]=5,2;\r\n[z]=40,60', '[benar] = [x]*([z]/[y]); \r\n[salah1] = [y]*([z]/[x]); \r\n[salah2] = [y]*([z]/([x]*2)); \r\n[salah3] = [x]*([z]/([y]*2))', 'a=[benar]; <br />\r\nb=[salah1]; <br />\r\nc=[salah2]; <br />\r\nd=[salah3] ', '2020-06-05 15:14:07.086689', 14, 3, '---'),
