(13, 7, 'Bangun ruang 2', 'Manakah yang merupakan jaring-jaring kubus?', 5, 'mapping', '[]', '', '---', 'a. [kubus]<br />\r\nb. [b1]<br />\r\nc. [b2]<br />\r\nd. [b3]', '2020-06-07 00:12:33.032318', 24, 3, '[kubus]=https://firebasestorage.googleapis.com/v0/b/aigyujiem-image.appspot.com/o/images%2F1591488721.7419241591413765.580696Artboard1_2.jpg?alt=media,https://firebasestorage.googleapis.com/v0/b/aigyujiem-image.appspot.com/o/images%2F1591488722.4511361591413765.005054Artboard1.jpg?alt=media; [b1]=https://firebasestorage.googleapis.com/v0/b/aigyujiem-image.appspot.com/o/images%2F1591488730.7907771591413781.706969Artboard2_2.jpg?alt=media,https://firebasestorage.googleapis.com/v0/b/aigyujiem-image.appspot.com/o/images%2F1591488731.3800651591413781.130158Artboard2.jpg?alt=media; [b2]=https://firebasestorage.googleapis.com/v0/b/aigyujiem-image.appspot.com/o/images%2F1591488739.3364331591413793.624082Artboard2_5.jpg?alt=media,https://firebasestorage.googleapis.com/v0/b/aigyujiem-image.appspot.com/o/images%2F1591488739.8991151591413793.058983Artboard2_4.jpg?alt=media; [b3]=https://firebasestorage.googleapis.com/v0/b/aigyujiem-image.appspot.com/o/images%2F1591488748.4412341591413803.574121Artboard2_8.jpg?alt=media,https://firebasestorage.googleapis.com/v0/b/aigyujiem-image.appspot.com/o/images%2F1591488749.047251591413803.038363Artboard2_7.jpg?alt=media'),
(14, 11, 'Keuntungan Penjualan Tiket', 'Harga tiket kelas I dalam final Piala Presiden 2018 adalah Rp 500.000,00. Panitia menyediakan [x] baris untuk kelas I, dengan rincian pada baris pertama terdapat [a] kursi, baris kedua [b] kursi, pada baris ketiga [c] kursi dan seterusnya. Jika kursi terisi semua pada kelas tersebut, maka pendapatan yang diterima dari kelas I adalah....', 5, 'mapping', '[\'[x]\', \'[a]\', \'[b]\', \'[c]\']', '[x]= 5, 8;\r\n[a]= 6, 8;\r\n[b]= 10, 10;\r\n[c]= 14, 12', '[beda] = [b]-[a];\r\n[u1] = [a];\r\n[n] = [x]-1;\r\n[Sx] = ([x]/2)*(2*[u1]+[beda]*[n]);\r\n[benar] = [Sx]*500000;\r\n[salah] = [Sx] * 100000', 'a. Rp [benar]<br />\r\nb. Rp [salah]<br />\r\n ', '2020-06-07 13:51:07.590815', 26, 3, '---'),
(16, 11, 'Nilai K', 'Diketahui&nbsp;<span class=\"math-tex\">\\(A = \\begin{pmatrix} [a1] &amp; [a2] \\\\ [a3] &amp; [a4] \\end{pmatrix} \\)</span>&nbsp;&nbsp;, nilai k yang&nbsp;<span class=\"math-tex\">\\(k det(A^T) = det(A^{-1})\\)</span> memenuhi adalah&hellip;.', 5, 'mapping', '[\'[a1]\', \'[a2]\', \'[a3]\', \'[a4]\']', '[a1]= 4, 2;\r\n[a2]= -1, -1;\r\n[a3]= 3, 4;\r\n[a4]= -2, 3', '[detA] = [a1]*[a2]-[a3]*[a4];\r\n[detAinv] = 1/[detA];\r\n[k] = [detAinv] / [detA]', '[k]', '2020-06-07 14:03:27.727071', 27, 3, '---'),
(17, 11, 'Soal Gambar', 'Persamaan grafik fungsi pada gambar di bawah adalah&hellip;.&nbsp;', 5, 'mapping', '[]', '', '---', '[a]', '2020-06-07 14:37:27.877526', 28, 3, '[a]=https://firebasestorage.googleapis.com/v0/b/aigyujiem-image.appspot.com/o/images%2F1591540621.211191-_200409113810-533.jpg?alt=media,https://firebasestorage.googleapis.com/v0/b/aigyujiem-image.appspot.com/o/images%2F1591540623.067145e8ee588a7d8f.jpg?alt=media,https://firebasestorage.googleapis.com/v0/b/aigyujiem-image.appspot.com/o/images%2F1591540623.559612019_11_13-12_54_16_13b6ab39c14f8ae887b5efb9363f5348_960x640_thumb.jpg?alt=media'),
(18, 11, 'Soal Aritmatika', '<strong>Harga tiket kelas I dalam final Piala Presiden 2018 adalah Rp 500.000,00. Panitia menyediakan [x] baris untuk kelas I, dengan rincian pada baris pertama terdapat [a] kursi, baris kedua [a2] kursi, pada baris ketiga [a3] kursi dan seterusnya. Jika kursi terisi semua pada kelas tersebut, maka pendapatan yang diterima dari kelas I adalah....</strong>', 5, 'mapping', '[\'[x]\', \'[a]\', \'[a2]\', \'[a3]\']', '[x]= 6,8, 10;\r\n[a]= 6,8, 10;\r\n[a2]= 8, 10, 12;\r\n[a3]= 10, 12, 14', '[b] = [a2]-[a];\r\n[n1] = [x]-1;\r\n[Sn] = ([x]/2)*(2*[a]+[n1]*[b]);\r\n[benar] = [Sn]*500000;\r\n[salah] = [Sn]*100000;\r\n[salah2] = [Sn]*250000;\r\n[salah3] = [Sn]*1000000', 'a. [benar]<br />\r\nb. [salah]<br />\r\nc. [salah2]<br />\r\nd. [salah3]', '2020-06-07 17:17:59.000000', 29, 3, '---'),
