(34, 22, 'Penyederhanaan Pecahan', 'Bentuk paling sederhana dari \\([x] \\over [y]\\) adalah?', 5, 'mapping', '[\'[x]\', \'[y]\']', '[x]=18, 30;\r\n[y]= 24, 36', '[a]=fpb([x], [y]);\r\n[b]=[x]/[a];\r\n[c]=[y]/[a];\r\n[d]=[b]+[c]', 'a. \\([b] \\over [c]\\)<br />\r\nb. \\([c] \\over [b]\\)<br />\r\nc.  \\([b] \\over [d]\\)<br />\r\nd. \\([a] \\over [d]\\)', '2020-06-17 19:10:43.480955', 43, 3, '---'),
(35, 22, 'Pendapatan Penjualan Tiket', 'Harga tiket kelas I dalam final Piala Presiden 2018 adalah Rp 500.000,00. Panitia menyediakan [x] baris untuk kelas I, dengan rincian pada baris pertama terdapat [a] kursi, baris kedua [a2] kursi, pada baris ketiga [a3] kursi dan seterusnya. Jika kursi terisi semua pada kelas tersebut, maka pendapatan yang diterima dari kelas I adalah....', 5, 'mapping', '[\'[x]\', \'[a]\', \'[a2]\', \'[a3]\']', '[x]= 6,8, 10;\r\n[a]= 6,8, 10;\r\n[a2]= 8, 10, 12;\r\n[a3]= 10, 12, 14', '[b] = [a2]-[a];\r\n[n1] = [x]-1;\r\n[Sn] = ([x]/2)*(2*[a]+[n1]*[b]);\r\n[benar] = [Sn]*500000;\r\n[salah] = [Sn]*100000;\r\n[salah2] = [Sn]*250000;\r\n[salah3] = [Sn]*1000000', 'a. [benar]<br />\r\nb. [salah]<br />\r\nc. [salah2]<br />\r\nd. [salah3]', '2020-06-17 19:11:52.792022', 32, 3, '---'),
(36, 16, 'nilai sin kuadran II', 'Nilai dari <span class=\"math-tex\">\\(sin\\)</span> [x]<span class=\"math-tex\">\\(^o\\)</span>&nbsp;adalah ....', 5, 'kombinasi', '[\'[x]\']', '[x]=120, 150', '[benar]=sin[x];\r\n[salah1]=cos[x];\r\n[salah2]=tan[x];\r\n[salah3]=1/sin[x];\r\n[salah4]=1/cos[x]', 'a. [benar]<br />\r\nb. [salah1]<br />\r\nc. [salah2]<br />\r\nd. [salah3]<br />\r\ne. [salah4]', '2020-06-20 11:49:19.902384', 51, 3, '---'),
(37, 16, 'barisan geometri', 'Agar membentuk barisan aritmetika, suku berikutnya dari barisan [u1], [u2], [u3], ....', 5, 'mapping', '[\'[u1]\', \'[u2]\', \'[u3]\']', '[u1]=2, 4;\r\n[u2]=6, 8;\r\n[u3]=10, 12', '[b]=[u2]-[u1];\r\n[benar]=[u1]+(3*[b]);\r\n[salah1]=[u1]+(3*[b])+1;\r\n[salah2]=[u1]+(3*[b])+2;\r\n[salah3]=[u1]+(3*[b])*2;\r\n[salah4]=[u1]+(3*[b])+4', 'a. [salah1]<br />\r\nb. [salah2]<br />\r\nc. [salah3]<br />\r\nd. [benar]<br />\r\ne. [salah4]', '2020-06-20 12:44:07.444192', 52, 3, '---'),
(38, 16, 'sketsa grafik fungsi kuadrat', 'Sketsa grafik untuk fungsi&nbsp;<span class=\"math-tex\">\\(f(x)=-x^2-5x+6\\)</span> adalah ....', 5, 'mapping', '[]', '', '---', 'a. [grafik]<br />\r\nb. [salah1]<br />\r\nc. [salah2]<br />\r\nd. [salah3]<br />\r\ne. [salah4]', '2020-06-20 13:15:01.087717', 53, 3, '[grafik]=https://firebasestorage.googleapis.com/v0/b/aigyujiem-image.appspot.com/o/images%2F1592658653.10266d.PNG?alt=media; [salah1]=https://firebasestorage.googleapis.com/v0/b/aigyujiem-image.appspot.com/o/images%2F1592658695.905282a.PNG?alt=media; [salah2]=https://firebasestorage.googleapis.com/v0/b/aigyujiem-image.appspot.com/o/images%2F1592658708.065009b.PNG?alt=media; [salah3]=https://firebasestorage.googleapis.com/v0/b/aigyujiem-image.appspot.com/o/images%2F1592658783.223743c.PNG?alt=media; [salah4]=https://firebasestorage.googleapis.com/v0/b/aigyujiem-image.appspot.com/o/images%2F1592658795.42426f.PNG?alt=media'),
(39, 16, 'nilai optimum', 'Nilai minimum dari fungsi&nbsp;<span class=\"math-tex\">\\(f(x)=[a]x^2+[b]x+[c]\\)</span>&nbsp;adalah....', 5, 'mapping', '[\'[a]\', \'[b]\', \'[c]\']', '[a]=1,2;\r\n[b]=4,-8;\r\n[c]=8,-10', '[t]=-[b];\r\n[y]=2*[a]', 'a. \\({[t] \\over [y]}\\);<br />\r\nb. ', '2020-06-20 14:04:49.394558', 54, 1, '---'),
(40, 28, 'Soal trigonometri', 'Jika nilai sin dari sebuah segitiga yaitu [x]/[y], maka nilai cos dari segitiga tersebut adalah?', 5, 'mapping', '[\'[x]\', \'[y]\']', '[x]=3, 5;\r\n[y]=5, 13', '[samping]=pow((([y]*[y])-([x]*[x])),0.5)', 'A. [samping]/[y];<br />\r\nB. [x]/[samping];<br />\r\nC. [y]/[samping];<br />\r\nD. [x]/[y];<br />\r\nE. 1/2', '2020-06-23 14:25:24.054287', 56, 3, '---'),
(41, 28, 'Titik Potong Sumbu Y', 'Berapakah titik potong f(x) =&nbsp;<span class=\"math-tex\">\\(x^2 - [a]x + [b]\\)</span>&nbsp;pada sumbu y?', 5, 'mapping', '[\'[a]\', \'[b]\']', '[a]=6,7;\r\n[b]=8,12', '[x1]= (-[a]+pow((([a]*[a])-(4*[b])),0.5))/2;\r\n[x2]= (-[a]-pow((([a]*[a])-(4*[b])),0.5))/2;\r\n[y]=[b]', 'A. ([y],0);<br />\r\nB. ([x1],0);<br />\r\nC. ([x2],0);<br />\r\nD. ([x1],[x2]);<br />\r\nE. ([y],[x1])', '2020-06-23 14:22:49.533774', 58, 3, '---'),
(42, 30, 'Soal Latihan Bab Trigonometri', 'Jika sin [x] = [y] ,maka nilai cos [z]=...', 5, 'mapping', '[\'[x]\', \'[y]\', \'[z]\']', '[x]= 0,30,45,60,90;\r\n[y]= 0,0.5,0.707,0.866,1;\r\n[z]= 90,60,45,30,0', '[benar]=([y]);\r\n[salah1]= ([benar]+1);\r\n[salah2]= ([benar]-1);\r\n[salah3]=(1-[benar]);\r\n[salah4]=(-[benar])', 'a. [salah1];<br />\r\nb. [salah2];<br />\r\nc. [benar];<br />\r\nd. [salah3];<br />\r\ne. [salah4]', '2020-06-23 15:12:25.423821', 59, 1, '---'),
(43, 7, 'muntub anjaysss', 'Hasil dari \\({[w] \\over [x]} - {[y] \\over [z]}\\) adalah ....', 5, 'kombinasi', '[\'[w]\', \'[x]\', \'[y]\', \'[z]\']', '[w]=11,12,13,14;\r\n[x]=21,22,23,24;\r\n[y]=31,32,33,34;\r\n[z]=41,42,43,44', '[a] = kpk([x],[z]);\r\n[b] = ([a]/[x]) * ([w]);\r\n[c] = ([a]/[z]) * ([y]);\r\n[d] = [b]-[c];\r\n[e] =[b]+[c]', 'A. <span class=\"math-tex\">\\([d] \\over [a]\\)</span><br />\r\nB. <span class=\"math-tex\">\\([c] \\over [a]\\)</span><br />\r\nC. <span class=\"math-tex\">\\([b] \\over [a]\\)</span><br />\r\nD. <span class=\"math-tex\">\\([e] \\over [a]\\)</span>', '2020-06-24 08:01:54.172060', 30, 1, '---'),
(44, 10, 'Ciri-ciri limas segi n', 'Berikut ini yang merupakan ciri-ciri dari bangun ruang limas segi [n] adalah?', 5, 'mapping', '[\'[n]\']', '[n]=3,4,5,6,8,9,10', '[m] = [n] + 2;\r\n[l] = [n] - 1', 'a. memiliki [m] titik sudut<br /><br />\r\nb. memiliki [l] sisi<br /><br />\r\nc. memiliki [m] rusuk<br /><br />\r\nd. memiliki [n] sisi tegak', '2020-07-08 06:40:17.204959', 61, 3, '---');
